import { Link } from "react-router-dom";
import { Button } from "@mui/material";

const MyPlayList = () => {
  return (
    <>
      <h1>my playlist page</h1>
      <Button
        variant="outlined"
        color="primary"
        component={Link}
        to="/menu"
      >Back to menu</Button>
    </>
  );
};
export default MyPlayList;
